import Layout from "../components/MyLayout";
import Header from '../components/Header';
import { Component } from "react";

export default class About extends Component {

    constructor(props) {
        super(props);
        this.state = {
            someVal: [1, 2, 4, 5]
        }

    }

    componentDidMount() {
        let smallInt;
        console.log("Chk max arr values = ", this.state.someVal)

        let x = this.state.someVal.toString();
        let chkMax = Math.max(x)
        console.log("Chk max = ", chkMax)

    }

    render() {

        return (

            <div>
                <Header />
                <Layout >



                    About Project release management!
            </Layout>


            </div>
        )
    }

}
